import React from "react";
import {
  Header,
  Hero,
  Logos,
  Features,
  HowItWorks,
  Pricing,
  FAQ,
  CTA,
  Footer,
} from "./components/landing-components";

export default function LandingPage() {
  return (
    <div className="flex min-h-[100dvh] flex-col">
      <Header />
      <main className="flex-1">
        <Hero />
        <Logos />
        <Features />
        <HowItWorks />
        <Pricing />
        <FAQ />
        <CTA />
      </main>
      <Footer />
    </div>
  );
}
